                    <p>hjkkhhsncjsdsil</p> 
                    <h1 style={{fontSize:50, color:"green"}}>
                        the new message: {5>6? "5<6":"5<6"}
                    </h1>} */
                }
            </div>
        )
    }
}

class Hello extends React.Component {
    constructor(props){
        super(props)
    }
    render(){
        return(
            <div> 
                <h2>Hello {this.props.data.name} and your id is {this.props.data.id}</h2>
            </div>
        )
    }
}

class TableRaw extends React.Component {
    constructor(props){
        super(props)
    }
    render(){
        return(
            <tr>
                <td>{this.props.data.id}</td>
                <td>{this.props.data.name}</td>
            </tr>
        )
    }
}

